import styles from "../styles/_about.module.scss";

import Header from "./Header";

const About = () => {
    return (
        <>
            <Header />
            <div className={styles.flex_container}>
                <div className={styles.flex_item_title}>
                    &lt;div 
                    <span className={styles.yellow}>id</span>=
                    <span className={styles.green}>"about"</span>
                    <span className={styles.pink}>&gt;</span>
                    <br />
                </div>
                <div className={styles.flex_item_content}>
                    Born in Poland in 1986, I came to Germany a few years later
                    with my parents and just two suitcases. Many years later I
                    graduated in communication design, worked in retail for
                    years and opened my own kids concept store. My heart
                    definitely beats for pretty things. Also for design. And for
                    code.
                </div>
                <div className={styles.flex_item_title}>&lt;/div&gt;</div>
            </div>
        </>
    );
};

export default About;
